import React from 'react';

const Contact = () => {
    return (
        // eslint-disable-next-line jsx-a11y/anchor-is-valid
        <a name="contact">
        <main className="dark-bg">
            <h2>Get in Touch</h2>
        </main>
        </a>
    );
};

export default Contact;
